  `processId` varchar(64) DEFAULT NULL COMMENT '流程id',
  `reApply` varchar(4) DEFAULT '0' COMMENT '是否补货 1：补货 0：首次申请',
  `approval` varchar(256) DEFAULT NULL COMMENT '审批意见',
  `descri` varchar(512) DEFAULT NULL COMMENT '入库说明',
