CREATE TABLE `sys_message` (
  `id` int(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `title` varchar(128) DEFAULT NULL COMMENT '标题',
  `message` text COMMENT '消息内容',
  `sender` varchar(64) DEFAULT NULL COMMENT '发送者',
  `receiver` varchar(64) DEFAULT NULL COMMENT '接收者',
  `type` varchar(2) DEFAULT NULL COMMENT '消息类型',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `status` varchar(1) DEFAULT NULL COMMENT '0:未读，1：已读',
  `send_status` varchar(2) DEFAULT NULL COMMENT '消息发送状态：0:=草稿；1=已发送',
  `send_time` datetime DEFAULT NULL COMMENT '发送时间',
  `work_flow_type` varchar(64) DEFAULT NULL COMMENT '工作流类型',
  `task_id` varchar(64) DEFAULT NULL COMMENT '任务id',
  `process_id` varchar(64) DEFAULT NULL COMMENT '流程id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=530 DEFAULT CHARSET=utf8 COMMENT='站内消息';

-- ----------------------------
-- Records of sys_message
-- ----------------------------

-- ----------------------------
-- Table structure for sys_notice
-- ----------------------------
DROP TABLE IF EXISTS `sys_notice`;
CREATE TABLE `sys_notice` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `title` varchar(255) DEFAULT NULL COMMENT '标题',
  `type` int(11) DEFAULT NULL COMMENT '类型',
  `content` text COMMENT '内容',
  `createtime` datetime DEFAULT NULL COMMENT '创建时间',
  `creater` int(11) DEFAULT NULL COMMENT '创建人',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='通知表';

-- ----------------------------
-- Records of sys_notice
-- ----------------------------

-- ----------------------------
-- Table structure for sys_operation_log
-- ----------------------------
DROP TABLE IF EXISTS `sys_operation_log`;
CREATE TABLE `sys_operation_log` (
  `id` int(65) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `logtype` varchar(255) DEFAULT NULL COMMENT '日志类型',
  `logname` varchar(255) DEFAULT NULL COMMENT '日志名称',
  `userid` int(65) DEFAULT NULL COMMENT '用户id',
  `classname` varchar(255) DEFAULT NULL COMMENT '类名称',
  `method` text COMMENT '方法名称',
  `createtime` datetime DEFAULT NULL COMMENT '创建时间',
  `succeed` varchar(255) DEFAULT NULL COMMENT '是否成功',
  `message` text COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1943 DEFAULT CHARSET=utf8 COMMENT='操作日志';

-- ----------------------------
-- Records of sys_operation_log
-- ----------------------------

-- ----------------------------
-- Table structure for sys_relation
-- ----------------------------
DROP TABLE IF EXISTS `sys_relation`;
CREATE TABLE `sys_relation` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `menuid` bigint(11) DEFAULT NULL COMMENT '菜单id',
  `roleid` int(11) DEFAULT NULL COMMENT '角色id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6282 DEFAULT CHARSET=utf8 COMMENT='角色和菜单关联表';

-- ----------------------------
-- Records of sys_relation
-- ----------------------------

-- ----------------------------
-- Table structure for sys_role
-- ----------------------------
DROP TABLE IF EXISTS `sys_role`;
CREATE TABLE `sys_role` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `num` int(11) DEFAULT NULL COMMENT '序号',
  `pid` int(11) DEFAULT '0' COMMENT '父角色id',
  `name` varchar(255) DEFAULT NULL COMMENT '角色名称',
  `tips` varchar(255) DEFAULT NULL COMMENT '提示',
  `version` int(11) DEFAULT NULL COMMENT '保留字段(暂时没用）',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=22 DEFAULT CHARSET=utf8 COMMENT='角色表';

-- ----------------------------
-- Records of sys_role
-- ----------------------------

-- ----------------------------
-- Table structure for sys_user
-- ----------------------------
DROP TABLE IF EXISTS `sys_user`;
CREATE TABLE `sys_user` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `avatar` varchar(255) DEFAULT NULL COMMENT '头像',
  `account` varchar(45) DEFAULT NULL COMMENT '账号',
  `password` varchar(45) DEFAULT NULL COMMENT '密码',
  `salt` varchar(45) DEFAULT NULL COMMENT 'md5密码盐',
  `name` varchar(45) DEFAULT NULL COMMENT '名字',
  `sex` varchar(4) DEFAULT NULL COMMENT '性别（1：男 2：女）',
  `roleid` varchar(255) DEFAULT NULL COMMENT '角色id',
  `deptid` int(11) DEFAULT NULL COMMENT '部门id',
  `status` int(11) DEFAULT NULL COMMENT '状态(1：启用  2：冻结  3：删除）',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `version` int(11) DEFAULT NULL COMMENT '保留字段',
  `creator` varchar(64) DEFAULT NULL COMMENT '操作人',
  `updator` varchar(64) DEFAULT NULL,
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `people_id` bigint(20) DEFAULT NULL COMMENT '管理人员id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=68 DEFAULT CHARSET=utf8 COMMENT='管理员表';

-- ----------------------------
-- Records of sys_user
-- ----------------------------

-- ----------------------------
-- Table structure for sys_user_leave
-- ----------------------------
DROP TABLE IF EXISTS `sys_user_leave`;
CREATE TABLE `sys_user_leave` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(50) DEFAULT NULL COMMENT '请假人姓名',
  `beginTime` varchar(30) DEFAULT NULL COMMENT '请假开始时间',
  `endTime` varchar(30) DEFAULT NULL COMMENT '请假结束时间',
  `leaveDays` decimal(10,1) DEFAULT NULL COMMENT '计算天数',
  `operator` varchar(50) DEFAULT NULL COMMENT '操作人',
  `operateTime` varchar(30) DEFAULT NULL COMMENT '操作时间',
  `updateTime` varchar(30) DEFAULT NULL COMMENT '更新时间',
  `leaveReason` varchar(500) DEFAULT NULL COMMENT '请假原因',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of sys_user_leave
-- ----------------------------

-- ----------------------------
-- Table structure for tax_apply
-- ----------------------------
DROP TABLE IF EXISTS `tax_apply`;
CREATE TABLE `tax_apply` (
  `id` int(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `name` varchar(64) DEFAULT NULL COMMENT '税务名称',
  `uuid` varchar(64) DEFAULT NULL COMMENT '工作流标识',
  `project_key` varchar(64) DEFAULT NULL COMMENT '项目key，业务主键',
  `project_id` int(20) DEFAULT NULL COMMENT '项目id',
  `batch_id` varchar(64) DEFAULT NULL COMMENT '申请批次',
  `process_id` varchar(64) DEFAULT NULL COMMENT '流程id',
  `appropriation_file_id` bigint(20) DEFAULT NULL COMMENT '拨付申请书',
  `foreign_certificate_file_id` bigint(20) DEFAULT NULL COMMENT '外经证',
  `project_local_tax_file_id` bigint(20) DEFAULT NULL COMMENT '项目所在地税票',
  `local_tax_file_id` bigint(20) DEFAULT NULL COMMENT '本地税票',
  `management_fee_file_id` bigint(20) DEFAULT NULL COMMENT '管理费支付凭证',
  `status` varchar(4) DEFAULT NULL COMMENT '0：草稿 1：已提交 2：已驳回 3：已终止 4：进行中 99：已完成',
  `descri` text COMMENT '备注',
  `creator` varchar(64) DEFAULT NULL COMMENT '创建者',
  `updator` varchar(64) DEFAULT NULL COMMENT '更新者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `project_local_tax_rate` decimal(10,2) DEFAULT NULL COMMENT '项目所在地税点',
  `project_local_tax_amount` decimal(10,2) DEFAULT NULL COMMENT '项目所在地税额',
  `work_local_tax_rate` decimal(10,2) DEFAULT NULL COMMENT '本地劳务税点',
  `work_local_tax_amount` decimal(10,2) DEFAULT NULL COMMENT '本地劳务税额',
  `manage_fee_rate` decimal(10,2) DEFAULT NULL COMMENT '管理费点',
  `manage_fee_amount` decimal(10,2) DEFAULT NULL COMMENT '管理费金额',
  `project_payment` decimal(10,2) DEFAULT NULL COMMENT '工程拨付款',
  `money_unit` varchar(20) DEFAULT NULL COMMENT '金额单位',
  `project_local_tax_payment` varchar(4) DEFAULT NULL COMMENT '项目所在地税额支付状态：0：未支付；1：已支付',
  `work_local_tax_payment` varchar(4) DEFAULT NULL COMMENT '本地劳务税收支付标志：0：未支付；1：已支付',
  `manage_fee_payment` varchar(4) DEFAULT NULL COMMENT '管理费支付标志：0：未支付；1：已支付',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of tax_apply
-- ----------------------------

